function titleChange(){var e=document.querySelector('meta[property="og:site_name"]'),t=e?e.getAttribute("content"):null,n=window.location.href,o=n.split("?")[1];if(o&&o.includes("=")){const e=document.querySelector("h1");var i=e.innerText;document.title=i+"の記事一覧 | "+t}else document.title="記事一覧 | "+t}titleChange();